import { useState } from "react"

function UseStateEight() {
    let [count, setCount] = useState(0) 
    function ChangeCount() {
        setCount(++count)
    }
    return (
        <>
        <form>
            <input type="text" />
            <span></span>
        </form>
        </>
    )
    
}

export default UseStateEight
